import React from "react";
import "../../fw-cuisining.css";    

const ProfileForm = () => {
  return (
    <div className="container d-flex justify-content-center align-items-center flex-column b-dashed">
        <h1 className="align-self-start mt-5 ml-5 font-weight-900">Cuisining</h1>
        <h2 className="align-self-start mt-3 ml-1 font-weight-600">Customize Profile</h2>
                <div className="d-flex align-items-center">
            <img 
                src="https://via.placeholder.com/150" 
                className="rounded-circle" 
                alt="Avatar" 
                style={{ width: '230px', height: '230px', backgroundColor: 'red' }} 
            />
            <div className="ms-3">
                <p className="mb-1">First Paragraph</p>
                <p className="mb-0">Second Paragraph</p>
            </div>
            </div>
    </div>
  );
};

export default ProfileForm;
